const triggerClick2Call = ({
  associatedEntityDetails,
  leadId,
  phoneNumber,
  schemaName,
  leadName
}: {
  leadName: string;
  schemaName: string;
  phoneNumber: string;
  leadId: string;
  associatedEntityDetails?: IAssociatedEntityDetails;
