    publishExternalAppEvent('lsq-marvin-click-2-call', {
      data: {
        phoneNumber: phoneNumber,
        schemaName: schemaName?.startsWith(replaceKey)
          ? schemaName?.replace(replaceKey, '')
          : schemaName,
        leadId: leadId,
        leadName: leadName,
        entityType: 'lead',
        associatedEntityDetails
      }
    });
  } catch (error) {
    trackError(error);
