// eslint-disable-next-line max-lines-per-function
const getReIssuedTokens = async (
  callerSource: CallerSource
): Promise<IAuthenticationConfig | null> => {
  const experienceConfig = getExperienceKey();
  try {
    startExperienceEvent({
      module: experienceConfig.module,
      experience: ExperienceType.Load,
      event: AuthEvents.ReissueToken,
      key: experienceConfig.key
    });

    const tokenDetails = getTokenConfig() as IToken;

    if (tokenDetails?.Token && tokenDetails?.RefreshToken) {
      const { Token, RefreshToken } = tokenDetails;
      const baseUrl = getEnvConfig(ENV_CONFIG.authAPIBaseURL) as string;

      const reIssuedToken: IAuthenticationConfig = (await httpRequest({
        url: `${baseUrl}${API_ROUTES?.tokenReIssue}`,
        method: HttpMethod.Post,
        body: JSON.stringify({
          Token,
          RefreshToken,
          IsMIPRequest: true
        }),
        requestConfig: {
          headers: new Headers({
            [AUTH_HEADERS.contentType]: 'application/json'
          }),
          doNotReIssueToken: true
        },
        callerSource: callerSource
      })) as IAuthenticationConfig;

      if (reIssuedToken?.Tokens) {
        persistAuthToken(reIssuedToken);
        return reIssuedToken;
      }
    }
  } catch (error) {
    trackError(error);
  } finally {
    endExperienceEvent({
      module: experienceConfig.module,
      experience: ExperienceType.Load,
      event: AuthEvents.ReissueToken,
      key: experienceConfig.key
    });
  }

  return null;
};

export { getReIssuedTokens };

import { DateRenderType } from 'apps/entity-details/types/entity-data.types';
import { classNames } from 'common/utils/helpers/helpers';
import { ReactNode } from 'react';
import styles from './date-time.module.css';

const splitByFirstWhitespace = (input: string): string[] => {
  const [date, ...rest] = input.split(' ');
  return [date, rest.join(' ')];
};

const DateTimeContent = ({
  formattedDate,
  renderType
}: {
  formattedDate: string;
  renderType: DateRenderType;
}): ReactNode => {
  const canShowWithSeparator =
    formattedDate?.trim()?.length &&
    (renderType === DateRenderType.Datetime || renderType === DateRenderType.DateWithTimezone);

  if (canShowWithSeparator) {
    const [dateString, timeString] = splitByFirstWhitespace(formattedDate);
    return (
      <div className={styles.date_time_container} title={formattedDate}>
        <span>{dateString}</span>
        <span
          data-testid="date-time-separator"
          className={classNames(styles.separator, 'ng_p_2_m')}
        />
        <span>{timeString}</span>
      </div>
    );
  }

  return <span title={formattedDate}>{formattedDate}</span>;
};

export default DateTimeContent;
